import React, { Component } from 'react';
import img from './2.jpg';

import './home.css';
import Photoplay from './photoplay';

class Home extends Component {

    render() {
        return (
            <div>
                <Photoplay />
                <section className="test">
                    <p><b>最新上市</b></p>
                    <div className="info">
                        
                        <div>
                            <div>
                                <a href="http://baidu.com">wqd</a>
                                <div></div>
                                <div>
                                    <h5>C03</h5><b></b>
                                    <span>无限重现</span>
                                </div>
                            </div>
                        </div>
                        <div>2</div>
                        <div>3</div>
                        <div>4</div>
                        <div>5</div>
                        <div>6</div>
                    </div>
                </section>
            </div>
        );
    }
}

export default Home;
